        uint8 matchCardinality;
        uint32 drawStartTimestampOffset;
        uint32 drawEndTimestampOffset;
        uint32 maxPicksPerUser;
        uint136 numberOfPicks;
        uint32[] distributions;
        uint256 prize;
    }
