pragma solidity 0.8.6;

import "./RingBuffer.sol";

/// @title Library for creating and managing a draw ring buffer.
library DrawRingBuffer {

  /// @notice Draw buffer struct.
  struct Buffer {
    uint32 lastDrawId;
    uint32 nextIndex;
    uint32 cardinality;
